import System.IO
import Data.List.Split
-- 不要在文件中加入关键字 let

mysignum x = 
    if x < 0 then
        -1
    else if x > 0 then
        1
    else
        0

f x = 
    case x of
     0 -> 1
     1 -> 5
     2 -> 2
     _ -> (-1)

roots a b c =
    let disc = sqrt(b * b - 4 * a * c)
        twice = 2 * a
    in ((-b + disc) / (2*a),
        (-b - disc) / (2*a))

sum' (x:xs) = x + sum' xs
sum' [] = 0

-- split string
ss l = splitOn " " l

-- string to int
cc l = read l :: Int

-- map for string to int
batchcc list = map cc list

-- split the string into number-string
split_string str = splitOn " " str

-- change to string
change_fileline_to_string fileline = map split_string fileline

-- change to number
change_string_number file_string = map batchcc file_string


p filelines = change_fileline_to_string filelines
w pp = change_string_number pp

